import React from "react";

const Menu = (props) => {
  return (
    <div
      class="md:overlay w-screen"
      onClick={() => {
        if (props.isOpen == true) {
          props.setOpen(false);
        }
      }}
    >
      <div
        class="modalContainer"
        onClick={(e) => {
          e.stopPropagation();
        }}
      >
        <p>Test</p>
      </div>
    </div>
  );
};

export default Menu;
